// Credit: https://craftpix.net/freebies/free-game-icons-fantasy-mage-outfit-pack-7/
import RedRobesImg from './red-robes.png';

const RedRobes = {
    name: 'Red Robes',
    type: 'armor::body',
    effect: {
        mana: 50,
    },
    image: RedRobesImg,
    value: 75,
};

export default RedRobes;
